(337, 25, 113, 49, 2, 1, 'Udall NW', 3, 0, 'PLEASE NOTE - IMPORTANT!  The match was not concluded, as Errea abandoned the match in the 90th minute.  Errea played with only 8 men throughout the match, until a player was hurt late in the match and left them with 7.  In the 90th minute, an Errea defender fouled a Simba player in the (Errea) defensive penalty area.  A penalty kick was awarded to Simba.  My watch hit full time and I announced to the two teams that the match was over, but being extended for the taking of the penalty kick.  At that time, Simba was leading 2 - 1.  An Errea player had gone off the field earlier for the injury, and a second player removed his jersey and left the field, leaving Errea with 6 men.  I tried to get the Goalkeeper to remain and allow the PK for Simba, but the Errea players indicated they couldn''t finish as they didn''t have a legal team.  Errea had abandoned the match and Simba was not able to conclude the PK.\r\n     Earlier in the match, I removed a fan for Simba from the playing area for calling me a "racist".  In approximately the 80th minute of the match, I had called a foul against a Simba player, and the offending fan yelled loudly enough for me to hear "the Referee called that because he is a racist".  I believed the statement to be racially motivated and requested the fan leave the area.  When the team would not assist, I threatened to stop the match, and then Simba requested the fan leave.  We determined after the match that the fan was not a registered player in the league (to determine whether a red card should have been issued and a report filed).', '2011-02-20', '09:00:00', 1),
