(459, 30, 129, 132, 0, 5, 'Udall NW', 0, 3, 'Wes Smith, CTR\r\nRobert Lopez, AR1\r\nChad Springetti, AR2\r\nFYI: Found set of car/house keys between Udall NE & NW...GMC car with LA Fitness tag and "AirBus" Tag...will keep till Satuday and then see if LA Fitness can identify the owner...Call me on my cell Wes 419-1188 or contact me via E-mail at william_es_smith@hotmail.com. Will also post on TMSL website.  Good Game!!!', '2011-06-16', '20:15:00', 1),
(460, 30, 131, 124, 5, 1, 'Udall S-Mid', 3, 0, 'A difficult game to referee because of their jerseys colors in the low sun and field lights.  Unfortunately, neither team had an alternative color or pinnies.  Also, neither team had consistent style jerseys so it was a mix of dark reds against maroons with all different types of shirts. ', '2011-06-16', '18:30:00', 1),
