(469, 29, 87, 26, 2, 3, 'Udall NW', 0, 3, 'Referee: Doug Schneider\r\nAR1: Jon Rowley\r\nAR2: Tony Noel\r\n\r\nCautions issued for UB\r\n\r\nThe league should require (insist) that teams have alternate jerseys. Neither team had a light jersey and played with black and purple. Made game difficult to officiate. Assistants had difficulty distinguishing at distance and some offside flags may have been missed. It puts the referee in a difficult position of deciding if the match should be suspended due to this issue. ', '2011-06-21', '20:15:00', 1),
