INSERT INTO `tmsl_misconduct` (`uid`, `ref_uid`, `ref_phone`, `game_uid`, `player_uid`, `team_name`, `season_uid`, `jersey_no`, `offense`, `explanation`) VALUES (1, 0, '', 171, 3214, 'ENFORCE', 26, '12', 'Second Yellow Card', 'Jesus Castro received a red card at minute 8:30 of the second half for accumulation of two yellow cards.  On both yellow cards Castro tackled an opponent in a dangerous way.'),
(2, 0, '', 171, 3222, 'ENFORCE', 24, '9', NULL, ''),
(3, 0, '520-407-6255', 197, 3005, 'ROMANS', 24, '10', 'Abusive Language/Gesture', 'Alberto was issued two cautions, both for dissent.\r\n\r\nTwenty minutes into the game, Alberto disagreed with a no-call.  After letting the player vent, I restarted play and began running away from Alberto''s position, he followed me and continued to yell.  I gave him another warning to "be quiet."  He failed to do so, and was issued his first caution.\r\n\r\nThirty minutes into the game Alberto, believed a fault committed by a Celtic player, against him warranted a caution, I did not agree.  A foul was awarded against the Celtic player.  Alberto became irate and began yelling at me.  I warned him that if he did not back-up and quiet down, he would be ejected.  He team attempted to calm Alberto up, but he kept-on yelling at me.  He was given several more warning, until I finally ejected him.\r\n\r\nAfter ejecting Alberto, he flipped me off, with his finger no-more that an inch from my face.  I backed-up and told him and his team that Alberto needed to leave now.  As his team was escorting him of the field, he yelled "fuck you" to me.'),
(4, 0, '', 171, 2423, 'ENFORCE', 27, '18', 'Acts Detrimental to Soccer', 'Played illegal player'),
(5, 0, '', 113, 2434, 'ENFORCE', 27, '8', 'Violent Conduct', 'Involved in fight on this game date; suspended for multiple games and played while suspended on 11/21/10'),
(6, 0, ' 9892953677', 217, 2121, 'Vikings', 24, '21', 'Second Yellow Card', '#21 received his first yellow for dissent.  \r\nHe received his second yellow for unsporting behavior. \r\nAfter the defender kicked the ball back in a clearing motion he almost kicked it in his own goal. The keeper deflected the ball over the net. The Vikings wanted a free kick in the box. #21 grabbed the ball and kicked it into the net from where they wanted the free kick. This upset the defender and he pushed number #21.  After #21 retaliated with a push they were both separated by their teammates. I immediately showed both of them yellow cards. I then backed off from the player to confer about the previous play.  The AR reminds me that this is number 21 second yellow. After we are done conferring I go show number #21 his red card and ask him to leave the field. He took one step toward the sidelines. Then he mumbles something. All I could understand was kick your ass. He got chest to chest with me but was quickly separated by his teammates. I asked if he was threatening me and he said yes I backed away and called the game with 19:58 remaining. \r\n'),
(7, 0, ' 520-203-7882', 212, 2630, 'BulldogsMen', 27, '9', 'Serious Foul Play', 'Serious Foul play - excessive force.  '),
(8, 0, ' ', 212, 3124, 'Hooligans FC', 27, '12', 'Foul Language (profanity)', ''),
(9, 0, '5204259404', 209, 2600, 'Legion', 24, '0', 'Second Yellow Card', ''),
(10, 0, ' 260-7435', 237, 3039, 'Atletico FC', 24, '7', 'Second Yellow Card', 'Two yellow cards, same game.  Both cards were given for reckless fouls.  Red was shown after 2nd yellow in minute 85.'),
(11, 0, '5204259404', 245, 2530, 'Legion', 24, '50', 'Violent Conduct', 'It was a violent conduct because the player kicked his opponent from behind intentionally and knowingly.'),
(12, 0, ' 289-2043', 248, 1690, 'Toltecs', 24, '17', 'Serious Foul Play', 'Deny goal scoring opportunity with a foul.  Goalkeeper was the last man between the attacker and the goal, approximately 5 yards outside the Penalty Area.  As the attacker was going around the keeper, the keeper reached in with his foot to kick the ball away.  He missed the ball, but tripped the attacker, who would have then had a clear shot on goal without any defense man in the way.  Foul occurred in the 85th minute of the match.'),
(13, 0, ' 520-471-0369', 246, 2669, 'BulldogsMen', 24, '12', 'Second Yellow Card', 'First yellow card was for persistent infringement in first half due to careless fouls.  Second yellow card was for unsporting behavior in second half: reckless foul with high potential for injury'),
(14, 0, '275-9582', 255, 2071, 'FC Spartak', 27, '13', 'Second Yellow Card', 'double yellow:  he pushed and shoved the keeper,  he pushed player #11.  Both players from Albion initiated the pushing but his style of play had several from Albion complaining.  In the first half when I gave him and the keeper the yellow I told them it could have been reds.  '),
(15, 0, ' 520-907-6151', 263, 3061, 'Hooligans FC', 24, '4', 'Foul Language (profanity)', 'In the first half of play, Mr. Blankinship fouled an opponent in a reckless manner near the touchline closest to AR Bob Bixby.  After calling the foul, I ran over and issued a caution for Unsporting Behavior for the foul.  Upon seeing the yellow card, Mr. Blankinship complained and then said "Fuck you" to me.  I issued the send off and displayed the red card.  His coach/manager was talking to him about this - Mr. Blankinship then told his coach/manager "Fuck you" as well.  Once he left the match, there were no more instances of any misconduct.  \r\n\r\nPlease note that I issued a caution and then a send off (not a second caution).'),
(16, 0, '', 267, 3343, 'Vikings', 24, '0', 'Violent Conduct', '36min. in, an attempt to score  by #16 (celtic) . defended by#15 (viking),both players went to ground. when celtic (#16)player player went to get up,#15 was over him, and as he went to get off him kick him on the inside of his thigh.'),
(17, 0, '915-539-3440', 258, 1258, 'FC BOSNA', 26, 'GK', 'Acts Detrimental to Soccer', 'At the 60th minute, Mario Knezevic (GK) of FC Bosna was sent off for denying a goal scoring opportunity by handling the ball.'),
(18, 0, '', 149, 752, 'Gremio', 26, '16', 'Acts Detrimental to Soccer', 'Spit and hit another player; referee determined it was not intentional'),
(19, 0, '5204259404', 284, 2781, 'Atletico FC', 24, '22', 'Foul Language (profanity)', 'this is what my AR reported to me, my AR raised his flag because the ball was out play and the player argued saying that the whole has to go out, by walking away he did call My AR fucking niger and I did tossed the player ( my AR Name is Mike Taku); \r\n\r\nby MAB - player states he said the call was a "fucking nightmare" and denies any racial comment. Claims witnesses from opposing team concur.'),
(20, 0, '', 291, 1725, 'ARYA', 24, '3', 'Abusive Language/Gesture', 'Dissent and foul and abusive language to the referee - "pendejo referee"'),
(21, 0, '520-407-6255', 301, 3224, 'Toltecs', 24, '1', 'Abusive Language/Gesture', 'In the 74th minute Jose was sent off for using foul language that was directed both at myself and at my AR, Carl Brunsting.\r\n\r\nJose was the goal keeper and a PK had been just taken against him.  The ball missed the net when Carl informed me that Jose had seriously encroached and the PK needed to be re-taken.  At the hearing of this, Jose kicked the ball away.  I cautioned him for this action.  At this point Jose began cussing at both Carl and myself.  Most of the cursing was in Spanish but I did recognize several words, including: mede, pinchi, puta, and fuck (which was said in English.  Jose was sent off for this, at which time he kicked another ball towards Carl.\r\n\r\nAfter the match, Carl told me that Jose was cursing at him again.  At the point Carl told me Jose was leaving, so no further actions were taken.'),
(22, 0, '', 293, 3077, 'FC Spartak', 25, '9', 'Second Yellow Card', 'Player #9, Adis Kovac received 2 cautions for dissent and was show the red card in the 82nd minute.'),
(23, 0, '', 293, 925, 'Bison Witches', 26, '20', 'Second Yellow Card', 'Player #20, William Fitz received 2 yellow cards for dissent and was shown the red card in the 70th minute'),
(24, 0, ' ', 314, 3343, 'Vikings', 24, '22', 'Violent Conduct', 'There were several players contesting for the ball just outside the Penalty Area, accompanied by a great amount of physical contact from all.  Vikings #22, Reynaldo Contreras, and Romans #10, Alberto Lopez were at the center of the engagement.  I could not tell who "fouled" who first, but Vikings #22 drew the send-off by taking both arms and giving Romans #10  a "bear hug" from behind, except that the bear hug motion was done very quickly, hence becoming  a deliberate striking of the opponent.  The "striking" motion was directed at the chest area, not the head area, but was provocative enough in nature to merit a send-off.'),
(25, 0, ' ', 351, 2583, 'MONGOLS', 24, '16', 'Violent Conduct', 'Mr.Plascencia was cautioned in the 17 minute of the 2nd half for a particulary blatant push to #21 on the Vikings...he was subbed.  He came back on the field after leaving briefly and got into an argument with Vikings player #23 while I was recording the initial incident.  He started swinging punches and was Red Carded and told to leave the area.  He continued with his agressive behavior and finally was made to leave by teammates, friends and family.  He returned to the field after the game was over and continued his agressive behavior at just about anyone who would approach him including players who were just arriving and several spectators...several people were hit by him, at which time we told him to leave..Again, and that the police were being called..His friends finally dragged him away, and we refrained from getting the police involved.  Moses Gonzales, my AR on that side was probably the closest to the several incidents which occured and was very helpful in calming and reporting the initial occurance.'),
(26, 0, ' ', 351, 218, 'Vikings', 24, '0', 'Violent Conduct', 'When Jaime Garcia was pushed deliberately in the 17th min. of the 2nd half, he retaliated with a deliberate push back to Monguls player #16, Rodolfo Plascencia.  Both players were cautioned and Roldolfo was subbed....but he came back on the field as I was recording the cautions and started to threaten and then took a swing at Jose Gonzales #23 of the Vikings.  Jose swung back...niether man connected and teammates of both had to restrain them both.  I ejected both from the match.  Jose left peacefully, unlike what subsequently occurred with Rodolfo of the Mongols per the other misconduct report which is attached.'),
(27, 0, '520-940-3830', 335, 2891, 'Bison Witches', 24, '7', 'Abusive Language/Gesture', 'Colin kicked the ball away and showed the AR the finger in angry gesture following the call from the AR...Colin did not argue and walked off the field immediately.\r\n\r\nSorin Suciu'),
(28, 0, ' 5592596119', 341, 2898, 'DEMON RUM', 27, '17', NULL, ''),
(29, 0, ' 437-7613', 336, 3195, 'INTERNAZIONALE', 25, '28', 'Second Yellow Card', 'Sabir was given a yellow card in the 48 min for dissent. He continued to show dissent and committed 3 foules in the next 2 min and was cautioned for persistant infingment as well as continued dissent. This resulted in a second yellow card and he left the field.'),
(30, 0, ' ', 385, 1948, 'Vikings', 28, '7', 'Second Yellow Card', 'Hand ball was called in the penalty area by both AR and Center. Mr. Dawass used foul language and threatening gestures to dissent the call. A yellow was issued. On a throw-in on the middle of the field, AR made a call. Mr. Dawass vehemently opposed the call and moved threateningly towards the AR, while using an elevated and disrespectful tone. Second Caution was issued. Player sent off.'),
(31, 0, ' 520-339-2730', 385, 226, 'Vikings', 24, '11', 'Referee Assault', 'After a call was made in the box, Mr. Ochoa grabbed my arm, in an effort to get my attention, with such force that it spun me around so that I was facing him. I immediately issued a red card for fear of violence against me. After the game, Mr. Ochoa was very remorseful.'),
(32, 0, '(520) 388-9814', 390, 3144, 'Hooligans FC', 25, '7', 'Second Yellow Card', 'Following ejection for second yellow (both for dissent), Mr. Gerhard said, "Fuck you" to center referee as he exited the field.  '),
(33, 0, '520 886-2073', 374, 2051, 'FC Spartak', 25, '7', 'Violent Conduct', 'At a stoppage of play, behind my back, Aliaksandr Makei punch an opponent in the chest.  This was reported to me by my AR Noah.'),
(34, 0, ' 437-7613', 395, 3314, 'FC Simba', 28, '3', 'Referee Assault', 'abdikadir had received a yellow card during play, after the game he and a team mate approached me. I was walking backwards telling them to return to their bench as the game was over, and he put his chest out and bumped me. '),
(35, 0, ' ', 395, 2542, 'FC Simba', 24, '15', 'Second Yellow Card', 'said recieved a yellow card in the 22 min for a very late tackle, he recieved his second in the 90th min for a dangerous tackle from behind.'),
(36, 0, ' ', 395, 2531, 'FC Simba', 24, '10', 'Violent Conduct', 'during hard play Abdirahman was fouled, the player that fouled him was cautioned, however before the play was finished he punched the opponent in the head. The ball had been placed and as he was leaving the field he ran back and kicked it out of play.'),
(37, 0, ' 437-7613', 395, 2537, 'FC Simba', 24, '12', 'Acts Detrimental to Soccer', 'Abdi had received a yellow card in the 17th min for dangerous foul play, during the match he had made several threats of getting even and showing what a real foul was. After the game he and a teammate approached me, he was yelling at me and and saying that they lost because of me, also that I was wrong that there is offsides on a goal kick. I was walking backwards and he followed me and would not back off, he was inches from my face and yelling violently, I asked him to go back to his bench as I did not want to send him off at this point the game was finished, he called me a mother fucker and said I could not send him off after the game was over, at this point I continued to walk backwards while showing him the red card. His team mate then stepped around him and bumped me with his chest .'),
(38, 0, '', 394, 1712, 'Strikers', 1, '11', 'Abusive Language/Gesture', 'During the 34th minute of play Ubermanshaft player fouled a Striker opponent.  Foul was called and Striker player Myles Stevens was asked to relax by the referee and he responded with "you fucking relax!".  In the 34th minute of play #11 Myles Stevens was sent off for abusive language.  As he walked away he also said "fucking faggots, you are all a bunch of little bitches, especially you in the green.  I''ll be waiting for you after the game".  Player left vicinity.'),
(39, 0, '2477874', 410, 1419, 'DT WASP', 1, '14', 'Serious Foul Play', 'In the 77th minute of play, the score 1-0 for Roma, DT WASP''s Dunnigan #14 was running on to the ball in the direction of Roma''s goalkeeper. The goalkeeper tried to collect the ball at the top of the goal area. Dunnigan stuck his cleat up facing the goalkeeper. Dunnigan''s cleat made contact with the goalkeeper''s hand which was pushed back into the goalkeeper''s face. I blew my whistle and showed Dunnigan the red card for Serious Foul Play. Dunnigan removed his shirt and reluctantly left the field of play. After the goalkeeper recovered, the game restarted with a free kick for Roma at the top of the goal area.'),
(40, 0, '2477874', 410, 2791, 'DT WASP', 27, '2', 'Foul Language (profanity)', 'In the 88th minute of play, the score 1-0 for Roma, Sias complained that I didn''t call a foul for his team, DT WASP. I told him I did not see a foul. Sias yelled at me and said "What the fuck are you looking at?" The ball was still in play so I told Sias he would be cautioned at the next stoppage. He then responded with, "Your calls are fucking bullshit." As he said that, the ball went out for a throw-in. I blew my whistle, called over Sias and showed him the red card for Foul Language. Sias''s second comment warranted the straight red card, not two cautions. He immediately left the field of play and the game was restarted with a throw-in.'),
(41, 0, '490-2585', 411, 2292, 'MONGOLS', 24, '4', 'Acts Detrimental to Soccer', 'Minute 38 of 1st half.  Ali was the last defender.  The ball is chipped to a Persian.  Ali grabbed the player to prevent him from taking the ball to the goal.  The Persian had already beat Ali to the ball and would have dribbled to the goal unimpeded.  The offense occurred by the semi circle of the penalty area.  DOGSO'),
(42, 0, '490-2585', 411, 2229, 'MONGOLS', 29, '3', 'Second Yellow Card', 'On two occassions Catallini deliberatly handled the ball to keep it from moving forward towards his goal.'),
(43, 0, '490-2585', 411, 2224, 'PERSIA', 24, '3', 'Serious Foul Play', 'Minute 12 of 2nd half.  The ball is centered towards the front of the Mongols goal.  Catallini (Mongols) attempted to save the ball from entering the goal.  Barillas carelessly and with force slide tackled Catallini, missed the ball but struck Catallini at the ankles.   Serious Foul Play.  He did not intent to hurt Catallini he was just careless.'),
(44, 0, '520-400-3846', 418, 998, 'T. C. Albion', 1, '11', 'Second Yellow Card', 'Mr. Fynn committed two reckless challenges on an opponent after the ball had been played. The first occurred in the thirty sixth minute of play. The second occurred in the eighty first minute of play. Mr Fynn was cautioned and subsequently shown a red card for his second act of misconduct. Prior to exiting the field of play Mr Fynn got in the face of two opponents and said "I''m gonna fuck you up!". No further incidents after exiting the field. '),
(45, 0, ' ', 472, 157, 'MONGOLS', 28, '2', 'Violent Conduct', 'At the 67 minute of the match. Andres Munoz # 2 from the Olympians'' was being fouled by a player from ARYA.  I then began to indicate the foul with the whistle.   Andres then started throwing his elbows in retaliation.  Just as I started to show him a yellow card for unsporting behavior he then kicked the ARYA player twice in a violent manner.  I then went from showing him a yellow card to showing him a red card to send him off the field for violent conduct.  Before he left Andres Munoz head butted the ARYA player twice in the head.  I followed Mr. Munoz off the field to make sure there were no further incidents.  After Andres left the field I then cautioned the player from ARYA for unsporting behavior for the initial foul.');
